er = ['#']; for (var i = 0; i \u003c missingZeros; i++) { resultBuilder.push('0'); } resultBuilder.push(hexString); return resultBuilder.join(''); }; // ..." }, "GoogleCloudDocumentaiV1DocumentRevision": { "type": "object", "properties": { "parentIds": { "type": "array", "description": "The revisions that this revision is based on. Must include all the ids that have anything to do with this revision - eg. there are `provenance.parent.revision` fields that index into this field.", "items": { "type": "string" } }, "processor": { "description": "If the annotation was made by processor identify the processor by its resource name.", "type": "string" }, "createTime": { "description": "The time that the revision was created.", "type": "string", "format": "google-datetime" }, "humanReview": { "description": "Human Review information of this revision.", "$ref": "GoogleCloudDocumentaiV1DocumentRevisionHumanReview" }, "parent": { "items": { "type": "integer", "format": "int32" }, "type": "array", "description": "The revisions that this revision is based on. This can include one or more parent (when documents are merged.) This field represents the index into the `revisions` field." }, "id": { "description": "Id of the revision. Unique within the context of the document.", "type": "string" }, "agent": { "type": "string", "description": "If the change was made by a person specify the name or id of that person." } }, "id": "GoogleCloudDocumentaiV1DocumentRevision", "description": "Contains past or forward revisions of this document." }, "GoogleCloudDocumentaiV1BatchProcessRequest": { "type": "object", "properties": { "skipHumanReview": { "description": "Whether Human Review feature should be skipped for this request. Default to false.", "type": "boolean" }, "documentOutputConfig": { "$ref": "GoogleCloudDocumentaiV1DocumentOutputConfig", "description": "The overall output config for batch process." }, "inputDocuments": { "$ref": "GoogleCloudDocumentaiV1BatchDocumentsInputConfig", "