eration in case of success. If the original method returns no data on success, such as `Delete`, the response is `google.protobuf.Empty`. If the original method is standard `Get`/`Create`/`Update`, the response should be the resource. For other methods, the response should have the type `XxxResponse`, where `Xxx` is the original method name. For example, if the original method name is `TakeSnapshot()`, the inferred response type is `TakeSnapshotResponse`.", "additionalProperties": { "description": "Properties of the object. Contains field @type with type URL.", "type": "any" }, "type": "object" }, "done": { "type": "boolean", "description": "If the value is `false`, it means the operation is still in progress. If `true`, the operation is completed, and either `error` or `response` is available." } }, "description": "This resource represents a long-running operation that is the result of a network API call.", "type": "object", "id": "GoogleLongrunningOperation" }, "GoogleCloudDocumentaiV1beta2DocumentStyle": { "id": "GoogleCloudDocumentaiV1beta2DocumentStyle", "properties": { "textDecoration": { "description": "Text decoration. Follows CSS standard. https://www.w3schools.com/cssref/pr_text_text-decoration.asp", "type": "string" }, "fontSize": { "$ref": "GoogleCloudDocumentaiV1beta2DocumentStyleFontSize", "description": "Font size." }, "backgroundColor": { "description": "Text background color.", "$ref": "GoogleTypeColor" }, "fontWeight": { "type": "string", "description": "Font weight. Possible values are normal, bold, bolder, and lighter. https://www.w3schools.com/cssref/pr_font_weight.asp" }, "textStyle": { "description": "Text style. Possible values are normal, italic, and oblique. https://www.w3schools.com/cssref/pr_font_font-style.asp", "type": "string" }, "color": { "description": "Text color.", "$ref": "GoogleTypeColor" }, "textAnchor": { "description": "Text anchor indexing into the Document.text.", "$ref": "GoogleCloudDocumentaiV1beta2DocumentTextAnchor" } }